import Description from '../Description/Description';
import NavSearch from '../NavSearch/NavSearch';
import { Wrapper, NavWrap } from './HeaderElements.js';
const Header = () => {
  return (
    <>
      <Wrapper>
        <NavWrap>

          <NavSearch />
        </NavWrap>
        <Description />
      </Wrapper>
    </>
  );
};

export default Header;
